import Pokemon from './Pokemon'

export default function Pokemons({ pokemons }) {
  return (
    <section>
      <h1>Listsde med pokemons</h1>
      <ul>
        {pokemons?.map((pokemon) => (
          <li key={pokemon.id}>
            <Pokemon id={pokemon.id} name={pokemon.name} />
          </li>
        ))}
      </ul>
    </section>
  )
}
